import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faInstagram } from '@fortawesome/free-brands-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faTwitter } from '@fortawesome/free-brands-svg-icons';

const Output = () => {
  const footer = {
    color: 'red',
  };

  const foot = {
    textAlign: 'center',
  };

  const items = {
    margin: '1%',
    color: 'green',
    animation: 'easeIn 2s ease-out', // Local animation for this component
  };

  const styles = `
    @keyframes easeIn {
      0% { opacity: 0; transform: translateX(-120px); }
      100% { opacity: 1; transform: translateY(0); }
    }
  `;

  return (
    <div style={foot}>
      <style>{styles}</style>
      <h3>Designed and Developed by</h3>
      <h2 style={footer}> Abishek &hearts;</h2>
      <div>
        <a href="https://www.linkedin.com/in/abishek-n7/">
          <FontAwesomeIcon style={items} icon={faLinkedin} />
        </a>
        <a href="https://www.instagram.com/its_me._.ak/">
          <FontAwesomeIcon style={items} icon={faInstagram} />
        </a>
        <a href="https://github.com/Abishek-ak7">
          <FontAwesomeIcon style={items} icon={faGithub} />
        </a>
        <a href="https://twitter.com/sreeabishek215">
          <FontAwesomeIcon style={items} icon={faTwitter} />
        </a>
      </div>
    </div>
  );
};

export default Output;
